import {Switch} from "react-router-dom/cjs/react-router-dom.min";
import "./App.scss";
import Home from "./pages/home/Home";
import Watch from "./pages/watch/Watch";

import {BrowserRouter as Router, Route, Routes} from "react-router-dom";

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/">
                    <Home />
                </Route>
                <Route path="/movies">
                    <Home type="movies" />
                </Route>
                <Route path="/series">
                    <Home type="series" />
                </Route>
            </Switch>
            {/* <Routes>
